private DocIdSetIterator getDISI(Filter filter, IndexReader reader)
throws IOException {
    DocIdSet docIdSet = filter.getDocIdSet(reader);
    if (docIdSet == null) {
      return EmptyDocIdSetIterator.getInstance();
    } else {
      DocIdSetIterator iter = docIdSet.iterator();
      if (iter == null) {
        return EmptyDocIdSetIterator.getInstance();
      } else {
        return iter;
      }
    }
}

